import Link from "../Link/Link";

const Navbar = (props) => {
  const navItems = [
    {
      id: 1,
      navLabel: "Home",
      navUrl: "#",
    },
    {
      id: 2,
      navLabel: "About",
      navUrl: "#",
    },
    {
      id: 3,
      navLabel: "Service",
      navUrl: "#",
    },
    {
      id: 4,
      navLabel: "Features",
      navUrl: "#",
    },
    {
      id: 5,
      navLabel: "Contact Us",
      navUrl: "#",
    },
  ];
  return (
    <div className="menu-item">
      <ul>
        {navItems.map((item, index) => {
          return (
            <Link
              key={index}
              url={item.navUrl}
              linkText={item.navLabel}
              className="nav-item"
            />
          );
        })}
      </ul>
    </div>
  );
};

export default Navbar;
